import React, { useState } from 'react';
import '../Style/PolicyList.css';

const PolicyList = () => {
  const [policies, setPolicies] = useState([
    { name: 'India Country Rule' },
    { name: 'US Country Rule' },
    // Add more policies as needed
  ]);

  const [isPopupOpen, setIsPopupOpen] = useState(false);
  const [newPolicyName, setNewPolicyName] = useState('');
  const [newPolicyID, setNewPolicyID] = useState('');
  const [rules, setRules] = useState([{ key: '', operator: '', values: '' }]);

  const handleAddRule = () => {
    setRules([...rules, { key: '', operator: '', values: '' }]);
  };

  const handleRemoveRule = (index) => {
    const newRules = [...rules];
    newRules.splice(index, 1);
    setRules(newRules);
  };

  const handleSavePolicy = () => {
    setPolicies([...policies, { name: newPolicyName }]);
    setIsPopupOpen(false);
    setNewPolicyName('');
    setRules([{ key: '', operator: '', values: '' }]);
  };

  return (
    <div className="policy-list">
      <h2>Policy Management</h2>
      <button className="create-policy-button" onClick={() => setIsPopupOpen(true)}>Create Policy</button>
      <table>
        <thead>
          <tr>
            <th>Policy Name</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {policies.map((policy, index) => (
            <tr key={index}>
              <td>{policy.name}</td>
              <td>
                <button>view</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      {isPopupOpen && (
        <div className="popup">
          <div className="popup-content">
            <h2>Create/Edit Policy</h2>
            <button onClick={() => setIsPopupOpen(false)}>Back to List</button>
            <div>
              <label>Policy Id:</label>
              <input
                type="text"
                value={newPolicyID}
                onChange={(e) => setNewPolicyID(e.target.value)}
              />
            </div>
            <div>
              <label>Policy Name:</label>
              <input
                type="text"
                value={newPolicyName}
                onChange={(e) => setNewPolicyName(e.target.value)}
              />
            </div>
            <div>
              <label>Data Policy:</label>
            </div>
            {rules.map((rule, index) => (
              <div key={index} className="rule">
                <label>Rule:</label>
                <div>
                  <label>Key:</label>
                  <input
                    type="text"
                    value={rule.key}
                    onChange={(e) => {
                      const newRules = [...rules];
                      newRules[index].key = e.target.value;
                      setRules(newRules);
                    }}
                  />
                </div>
                <div>
                  <label>Operator:</label>
                  <input
                    type="text"
                    value={rule.operator}
                    onChange={(e) => {
                      const newRules = [...rules];
                      newRules[index].operator = e.target.value;
                      setRules(newRules);
                    }}
                  />
                </div>
                <div>
                  <label>Values:</label>
                  <input
                    type="text"
                    value={rule.values}
                    onChange={(e) => {
                      const newRules = [...rules];
                      newRules[index].values = e.target.value;
                      setRules(newRules);
                    }}
                  />
                </div>
                <button onClick={() => handleRemoveRule(index)}>Remove Rule</button>
              </div>
            ))}
            <button onClick={handleAddRule}>Add Rule</button>
            <button onClick={handleSavePolicy}>Save Policy</button>
          </div>
        </div>
      )}
    </div>
  );
};

export default PolicyList;
